def f_base(plateau,poids):
    d=len(plateau)
    n=int(math.sqrt(len(poids)))
    conv=[]
    for i in range(d-n+1):
        conv.append([])
        for j in range(d-n+1):
            conv[i].append(0)
            
            for k in range(n):
                for l in range(n):
                    conv[i][j]+=poids[n*k+l]*(plateau[i+k][j+l])
                    
    return conv




def f_evo(plateau,poids):
    rep=0
    n=len(poids)
    for i in poids:
        rep+=f_base(plateau,i)
    return rep/n


def f_cook(plateau,lpoids):
    for i in lpoids:
        plateau=f_base(plateau,i)
    return plateau



def descente(poids,fon):
    grad = [[float('inf')]*len(i) for i in poids]
    f0=float('inf')
    f1=float('inf')
    delta=10
    def norme(l):
        r=0
        for i in l:
            for j in i:
                r+=abs(j)
        return r
    while norme(grad)>1e-4 and delta>1e-5:
        f0=fon(poids)
        
        if f0>f1:delta/=2

        for j in range(len(poids)):
            for i in range(len(poids[j])):
                poids[j][i]+=1e-5
                grad[j][i]=(fon(poids)-f0)*10**10
                poids[j][i]-=1e-5
        
        g=norme(grad)
        
        if g==0:
            print('uytf')
            return poids
        for j in range(len(poids)):            
            for i in range(len(poids[j])):
                poids[j][i]-=delta*grad[j][i]/g
        
        f1=f0
        print(g,delta,f0)
    return poids



def apprentissage(k):
    err=float('inf')
    for i in range(k):
        print()
        print(i)
        l=[]
        for i in range(7):
            l.append([np.longfloat(rd.uniform(-100,100)) for i in range(4)])
        fgh=descente(l,erreur)
        mem=erreur(fgh)
        if mem<err:
            rep=l[:]
            err=mem
        print(fgh,err)
    return rep


def erreur(poids):
    err=0
    for i in range(1800):
        err+=(math.tanh(f_cook(train_images[i],poids)[0][0])-train_labels[i])**2
    return err/1800


